def powertrain(n):
    p, s = 1, str(n)
    if len(s)%2 == 1: s += '1'
    for b, e in zip(s[0::2], s[1::2]): p *= int(b)**int(e)
    return p
def aupto(limit, target=0):
    alst = []
    for n in range(1, limit+1):
        m, ptm = n, powertrain(n)
        while m != ptm: m, ptm = ptm, powertrain(ptm)
        if m == target: alst.append(n)
    return alst
